import { useSpring, animated } from 'react-spring';
import styles from './Header.module.css';

const Header = () => {
  const fadeIn = useSpring({ opacity: 1, from: { opacity: 0 }, config: { duration: 1000 } });

  return (
    <header className={styles.header}>
      <animated.img
        style={fadeIn}
        className={styles.headerBackground}
        src="./img/layout/wroclaw1.jpg"
        alt="Wroclaw"
      />
      <animated.p style={fadeIn} className={`${styles.logo} ${styles.headerText}`}>
        Wrocław Dom. Twój przewodnik w świecie nieruchomości
      </animated.p>
    </header>
  );
}

export default Header;
